            public override void ApplyState (Gum.DataTypes.Variables.StateSave state) 
            {
                bool matches = this.ElementSave.AllStates.Contains(state);
                if (matches)
                {
                    var category = this.ElementSave.Categories.FirstOrDefault(item => item.States.Contains(state));
                    if (category == null)
                    {
                        if (state.Name == "Default") this.mCurrentVariableState = VariableState.Default;
                    }
                    else if (category.Name == "ResourceType")
                    {
                        if(state.Name == "Gold") this.mCurrentResourceTypeState = ResourceType.Gold;
                        if(state.Name == "Lumber") this.mCurrentResourceTypeState = ResourceType.Lumber;
                        if(state.Name == "Stone") this.mCurrentResourceTypeState = ResourceType.Stone;
                        if(state.Name == "Capacity") this.mCurrentResourceTypeState = ResourceType.Capacity;
                    }
                    else if (category.Name == "TextColor")
                    {
                        if(state.Name == "CanAfford") this.mCurrentTextColorState = TextColor.CanAfford;
                        if(state.Name == "CannotAfford") this.mCurrentTextColorState = TextColor.CannotAfford;
                    }
                }
                base.ApplyState(state);
            }
